INSERT INTO `beiwanglu` VALUES (1, '优化历史代码逻辑', '优化历史代码逻辑', '2023-11-19', '2', 2);
INSERT INTO `beiwanglu` VALUES (2, '对接标签打印(公众)', '实时对接标签打印\n二维码不对, 可能是id没传,等待测试\n\n品胜打印暂时异常,但是品胜的人预览是没有问题的, 还在对接', '2023-12-01', '2', 2);
