INSERT INTO `beiwanglu` VALUES (4, '联通公众每日任务需求(公众)', '联通公众每日任务需求=>每日任务跳转装维页面,需要对接详情页面还有进入项目权限的问题\r\n', '2023-11-20', '2', 2);
INSERT INTO `beiwanglu` VALUES (5, 'fttr能力(公众)', '入参 暂时是死的\n上线测试前记得改回来, \n后期会返回值, 要做关联\n目前加在工具箱中测试\n测试中.....\n看下怎么拿返回值\n返回值正在对接.......', '2023-12-01', '1', 2);
INSERT INTO `beiwanglu` VALUES (6, '调度与派单的地区修改(dev + 公众分支)', '调度与派单的地区修改还没有同步到公众分支       (dev + 公众分支)', '2023-11-20', '2', 2);
INSERT INTO `beiwanglu` VALUES (7, '公告问题(dev分支)', '公告问题还没有完全确认完成, 以及要不要同步到公众分支', '2023-11-20', '2', 2);
INSERT INTO `beiwanglu` VALUES (8, 'home页面优化(dev+公众)', 'home页面优化(dev+公众)', '2024-01-10', '2', 2);
INSERT INTO `beiwanglu` VALUES (111, '修障调度单新增是否重复故障字段(dev+公众)', '和张庭英对接:\n这个下面增加是否重复故障，如果是显示重复故障次数 加高亮, 并且跳转列表/Order/XZ/repeatFault , 也就是列表页, 然后列表跳转详情用Tools/HistoryOrder/Detail  的详情页进行匹配,\n\n\n IS_ASK_AGAIN 是否是重复故障  是/否\nASK_AGAIN_TIMES 重复次数 \n\n\n字段,\nwoId: woId\ncreateTime: CREATE_TIME\nbusiNo: account\nserviceName:appGetUnionHistoryOrderList\n\n重复故障跳转列详情,到历史单详情\nisHis = 0\nisHis = 1 \n\n\n现在列表引用组件的时候由于返回值不一样所以渲染有问题, 周一来要么加字段要么优化组件\n\n两个分支均已同步代码\n\n\n', '2023-11-28', '2', 2);
INSERT INTO `beiwanglu` VALUES (112, '修障调度单详情页面的关联营销单(dev+公众)', '关联营销单字段要做个判断, 如果是0就显示否, 如果大于0就正常显示,列表详情,让他跳转\nMARKET_ORDER_COUNT   0 没有营销单 大于0 就是营销单条数\nmarket_order_count\n进度:   两个分支均同步代码', '2023-11-29', '2', 2);
INSERT INTO `beiwanglu` VALUES (113, '工具箱增加终端密码功能入口(dev+公众)', '跟王众选对接:\n两个分支都已同步\n\n', '2023-12-01', '1', 2);
INSERT INTO `beiwanglu` VALUES (114, '非客服热线旁边新增一个类型页面,互联网感知故障(dev+公众)', '和非客服热线一个页面, 只是点击的时候传个单独的类型', '2023-12-01', '2', 2);
